import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { Dashboard } from './components/Dashboard';
import { Home } from './components/Home';
import { About } from './components/About';
import { Contact } from './components/Contact';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <div className="top-nav">
        <div className="brand">
          {/* Place your logo at public/logo.png (see README or instructions) */}
          <Link to="/">
            <img src="/logo.png" alt="TerraQuest" className="brand-logo" />
          </Link>
          <Link to="/" className="brand-title">TerraQuest</Link>
        </div>

        <div className="nav-items">
          <Link to="/" className="nav-link">Home</Link>
          <Link to="/dashboard" className="nav-link">Advanced Analysis</Link>
          <Link to="/about" className="nav-link">About</Link>
          <Link to="/contact" className="nav-link">Contact</Link>
        </div>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
